import { useForm } from "react-hook-form"

import React from 'react'
import { useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { plusCart } from "../../store/tocart/action";

function ToCart()  {
    const prod = useSelector(st=>st.tocartData.arr)
    const users = useSelector(st=>st.userData.profile)

    const dispatch = useDispatch();
    // const navigate=useNavigate()
    const onSubmit = (data) => {
        dispatch(plusCart());
    };

    

    return(
        <>
        <h1>To Cart</h1>
        <table>
            <tbody>
                {prod.map((item, index)=>{
                    return(
                        <tr key={index}>
                        <td>
                            <img src={item.img}/>
                        </td>
                        <td>{item.name}</td>
                        <td>{item.price}</td>
                        <td>{item.quantity}</td>
                        <td>
                            <button>-</button>
                            <button></button>
                        </td>
                        </tr>
                    )
                })
                }
            </tbody>
        </table>
        </>
    )
}

export default ToCart;
